import React from 'react';
import Card from "../UI/Card";
// import "./Form.css"


const Data = (props) => {

    if (props.alunos.length === 0) {
        return <h2>Sem despesas.</h2>
    }

    return (
        <Card>
            <ul>
                {props.alunos.map((alunos) => (
                    <h2>{alunos.nome}</h2>
                ))}
            </ul>
        </Card>

    );
}

export default Data;
